input.value:
timeseries avg(dt.runtime.jvm.memory_pool.used), by: { dt.entity.host }, filter: { matchesValue(dt.entity.host, "HOST-DC0DB28DECB9214E") }
| fieldsAdd dt.entity.host.name = entityName(dt.entity.host)
| append
[
  fetch logs
  | filter matchesValue(dt.entity.host, "HOST-DC0DB28DECB9214E")
  | fieldsAdd dt.entity.host.name = entityName(dt.entity.host)
  | filter status == "WARN" OR status == "ERROR"
  | makeTimeseries count=count(), by:{dt.entity.host.name}
]

